import React, { useState } from 'react';
import { Link, Redirect } from 'react-router-dom';
import { connect } from 'react-redux';
import { login } from '../actions/auth';


import * as TiIcons from "react-icons/ti";
import * as FaIcons from "react-icons/fa";




const Orders = ({  isAuthenticated }) => {
    const [formData, setFormData] = useState({
        email: '',

    });

    const { email } = formData;

    const onChange = e => setFormData({ ...formData, [e.target.name]: e.target.value });

    const onSubmit = e => {
        e.preventDefault();

        // login(email, password);
    };


    return (

    <div className="login">
                <div class="breadcrumb-option">
                <div class="container">
                <div class="row">
                    <div class="col-lg-12">
                        <div class="breadcrumb__links">
                        <Link to='/'><TiIcons.TiHome className="homeIcon"/> Home</Link>
                            <FaIcons.FaAngleRight/>
                            <span>Login</span>
                        </div>
                    </div>
                </div>
                </div>
            </div>  

            <section class="checkout spad">
            <div class="container">

                <form class="checkout__form" onSubmit={e => onSubmit(e)}>
                    <div class="row">
                        <div class="col-lg-12">
                            <h5>Login </h5>
                            <div class="row">
                                <div class="col-lg-12">                                
                                    <div class="checkout__form__input">
                                        <p>Rating <span>*</span></p>
                                        <textarea                                          
                                            className="text_area"
                                            type='text'                                          
                                            name='email'
                                            value={email}
                                            onChange={e => onChange(e)}
                                            required
                                        />
                                    </div>




                                </div>

                            <button type="submit" class="site-btn btn_login">Login</button>

                            </div>                                              

            </div>                                        
                    </div>

                </form>

            </div>
        </section>
        </div>


    )
}

// export default Login


const mapStateToProps = state => ({
    isAuthenticated: state.auth.isAuthenticated
});

export default connect(mapStateToProps, {  })(Orders);
